function CommonLogin() {    
    return (
      <> 
        <div id="modal">
            <h4>Сіз кімсіз?</h4>
            
            <div className="card">
               <img src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} class="card-img-top" alt="..." />
               <div class="card-body">
                <h5 class="card-title">Мұғалім</h5>
               </div>
            </div>


            <div id="image2">
              <img alt="ss" src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} width="100px" height="100px" />
              <h5>Студент</h5>
            </div>
        </div>  
  
      </>
    );
  }
  
  export default CommonLogin;
